import React, { useState } from "react";
import { makeStyles } from '@material-ui/core/styles';
import * as firebase from "firebase";

import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";
import Link from "@material-ui/core/Link";
import { AppBar, Toolbar, Typography, Button, IconButton } from '@material-ui/core';
import { AccountCircle } from '@material-ui/icons';
import { Link as LinkTo } from "react-router-dom";
import {useHistory} from 'react-router-dom';
import {
  useFirestore,
  AuthCheck,
  useUser,
  useFirestoreDocData,
} from 'reactfire';



function SignUp() {
  const [error, setError] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const history = useHistory();
  const userCollection = useFirestore().collection('users');

  const firebaseConfig = {
    apiKey: "AIzaSyAE6rcfe2QjFdVwwVtQN6dvEITo4mFgVPg",
    authDomain: "chronolo-geese.firebaseapp.com",
    databaseURL: "https://chronolo-geese.firebaseio.com",
    projectId: "chronolo-geese",
    storageBucket: "chronolo-geese.appspot.com",
    messagingSenderId: "538915612147",
    appId: "1:538915612147:web:2264447c48c615794f5e86",
    measurementId: "G-0F8Q557ERB",
  };

  //TODO get .env working
  const dotenv = require("dotenv");
  const env = dotenv.config().parse;

  if (!firebase.apps.length) {
    firebase.initializeApp(firebaseConfig);
  }

  let submit = async () => {
    console.log(email, password);
    firebase
      .auth()
      .createUserWithEmailAndPassword(email, password)
      .then((res) => setError("you have successfully signed up"))
      .catch(function (error) {
        // Handle Errors here.
        setError(error.message);
        // ...
      });
      firebase.auth().onAuthStateChanged(async function(user) {
        if (user) {
            console.log('This is the user: ', user)
            await userCollection.doc(user.uid).get().then((doc) => {
              if (!doc.exists) {
                userCollection.doc(user.uid).set({
                  displayName: user.displayName,
                  availability: [],
                  classCodes: [],
                  email: user.email,
                  isStudent: true,
                  uid: user.uid,
                });
              }
            }).catch(function(error) {
              console.log('Error getting document:', error);
            });
        } else {
            // No user is signed in.
            console.log('There is no logged in user');
        }
        history.push("/");
    });
    // const currUser = firebase.auth().currentUser;
    // await userCollection.doc(currUser.uid).get().then((doc) => {
    //   if (!doc.exists) {
    //     userCollection.doc(currUser.uid).set({
    //       displayName: currUser.displayName,
    //       availability: [],
    //       classCodes: [],
    //       isStudent: true,
    //     });
    //   }
    // }).catch(function(error) {
    //   console.log('Error getting document:', error);
    // });
  };


  return (
    <div>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            CHRONOLO-GEESE
          </Typography>
          <Button href="/" color="inherit">Home</Button>
          <Button href="/classrooms" color="inherit">Classrooms</Button>
          <IconButton
            aria-label="account of current user"
            aria-controls="primary-search-account-menu"
            color="inherit"
          >
            <AccountCircle />
          </IconButton>
        </Toolbar>
      </AppBar>

      <Grid
        container
        fullWidth
        spacing={0}
        direction="column"
        alignItems="center"
        justify="center"
        style={{ paddingTop: "8%" }}
      >
        <Grid
          container
          direction="column"
          justify="center"
          alignItems="center"
          spacing={2}
        >
          <Grid item>
            <Typography variant="h4">Sign Up</Typography>
          </Grid>
          <Grid item xs={12}>
            <TextField
              fullWidth
              id="email"
              label="email"
              onChange={(e) => setEmail(e.target.value)}
              variant="outlined"
              type="email"
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              fullWidth
              id="password"
              label="password"
              onChange={(e) => setPassword(e.target.value)}
              variant="outlined"
              type="password"
            />
          </Grid>
          {/* <Grid item xs={12}>
            <TextField
              fullWidth
              id="password"
              label="password"
              onChange={(e) => setEmail(e.target.value)}
              variant="outlined"
              type="password"
            />
          </Grid> */}
          <Grid item>
            <Button
              onClick={() => submit()}
              variant="contained"
              color="primary"
              type="submit"
            >
              Submit
            </Button>
          </Grid>

          <LinkTo to="/login">
            <Link component="button" variant="body2">
              Log In Instead
            </Link>
          </LinkTo>
        </Grid>
        <Typography variant="h6">{error}</Typography>
      </Grid>
    </div>
  );
}

export default SignUp;
